import  React, {Component} from 'react';
import axios from 'axios';

import Navbar from './Navbar';
import Header from './Header';
import Footer from './Footer';

import TeacherTableRow from './TeacherTableRow';

export default  class viewTeacher extends  Component{
    constructor(props) {
        super(props);
        this.state = {teachers : []};
    }

    componentDidMount() {
        axios.get('http://localhost:4000/teacher/')
            .then(response => {
                this.setState({teachers : response.data});

            })
            .catch(function (error){
                console.log(error);
            })
    }

    tabRow(){
        return this.state.teachers.map(function (object, i){
            return <TeacherTableRow obj = {object} key = {i}/>;
        });
        // return <OrderTableRow obj={this.state.orders}/>
    }


    render() {
        return(
            <div>
                <Header/>
                <Navbar/>
                <h3 align="center">Customers Orders</h3>
                       

                        <table className="table table-striped" style = {{marginTop :20}}>
                            <thead>
                                <tr>
                                    {/* <th>id</th> */}
                                    <th>FoodName</th>
                                    <th>TrianName</th>
                                    <th>Station</th>
                                    <th>QTY</th>
                                    <th>Date</th>
                                    <th>Price</th>
                                    <th>Phone Number</th>
                                    <th>eMail</th>
                                    <th>Payment</th>
                                    <th>deliverBy</th>
                                    <th colSpan="3">Action</th>
                                </tr>
                            </thead>
                            <tbody>
                                {this.tabRow()}
                            </tbody>
                        </table>
                <Footer/>
            </div>
        )
    }
}
